(1020520640, 'Supreme Chancellor Palpatine', 'card/chara/102052064/1020520640', 'Palpatine has spent years perfecting his plan to rule the galaxy. He has engineered wars, assassinations, and legislation; each a step toward securing more power. While the Jedi grow increasingly concerned over his growing influence, Palpatine knows that by the time they discover his true purpose it will be too late to stop him.', 3, 0, 2, 1, 0, 73817, 50, 18, 3570, 3920, 5001, 4800, 0, 0, 4760, 0, 7140, 1020520640, 0, 3, 1020520641, 0, 1, 0, 205, 1, 1, 1, 1, 0, 1, 18, 51, 0, 1, 1, 1, 0, 1, 140, 60, 1, 1000, 602, 11858, 0, 72075, 0, 1087, 3774, 106566, 772, 3861, 12876, 12876, 0, 27523, 0, 26549, 3953, 78261, 0, 0, 0, '2014-08-21 06', '2015-11-25 06', 'Skill Effect Down [Sml]', 'Reduces the effectiveness of all (DOWN/UP) Skills on the opposing units by 15.0%', 5001, 'Skill Effect Down [Sml]', 'Reduces the effectiveness of all (DOWN/UP) Skills on the opposing units by %s', 0, 1, 1, 2, 0, 0, 0, 0, 100, 80, 0, 80, 15, 2, 30, 40, '2015-11-18 06', 1, 10, 0, 0, '', 'Short', 'u003Cimg class=u0022rarity_s_04u0022 src=u0022http', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 1, 'u003Cimg class=u0022rarity_l_04u0022 src=u0022http', 6399, '1', '1 per Turn', 1, 1, 0, 0, '', '', '', 0, 4760, 7140, 0, 0, 2, 1, 0, 0, 0, 4760, 7140, 34, 50),
