(1012920140, 'Orn Free Taa', 'card/chara/101292014/1012920140', 'Outwardly jovial if a bit bumbling, Taa''s large shadow is nonetheless cast over nearly every aspect of Coruscant politics. Despite his gregarious nature, he is a staunch militarist and is ever alert for opportunities to put credits in his pocket. While his corruption is obvious, none can seem to find enough evidence of criminal behavior to oust him.', 3, 0, 2, 1, 0, 65553, 50, 20, 2660, 3360, 51341, 5000, 0, 0, 3760, 0, 5700, 1012920140, 0, 3, 1012920141, 0, 1, 0, 129, 1, 1, 1, 1, 0, 1, 18, 51, 0, 1, 1, 1, 0, 1, 130, 50, 1, 1000, 602, 11858, 0, 72075, 0, 1087, 3774, 0, 772, 3861, 12876, 12876, 0, 27523, 0, 26549, 3953, 78261, 0, 0, 0, '2014-12-25 06', '2015-11-25 06', '1-Card Dark Side u0026 Neutral Acceleration [Sml]', 'A small chance to increase the EVA of your Dark side or Neutral card positioned directly in front of this unit during battle. That unit''s attack frequency may also be increased by one. (Should that unit''s frequency be less than once per turn, the number of turns needed for the next attack will be decreased by one.) This Skill is not effective on Vehicles.', 51341, '1-Card Dark Side u0026 Neutral Acceleration [Sml]', 'A small chance to increase the EVA of your Dark side or Neutral card positioned directly in front of this unit during battle. That unit''s attack frequency may also be increased by one. (Should that unit''s frequency be less than once per turn, the number of turns needed for the next attack will be decreased by one.) This Skill is not effective on Vehicles.', 11, 1, 1, 1, 0, 5, 0, 0, 25, 30, 0, 30, 10, 2, 20, 40, '2015-11-18 06', 1, 10, 0, 0, '', 'Short', 'u003Cimg class=u0022rarity_s_04u0022 src=u0022http', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 1, 'u003Cimg class=u0022rarity_l_04u0022 src=u0022http', 6386, '1', '1 per Turn', 1, 1, 1, 0, '', '', '', 0, 3760, 5700, 0, 0, 2, 1, 0, 0, 0, 3760, 5700, 25, 50),
(1053810240, 'Mon Mothma', 'card/chara/105381024/1053810240', 'A passionate idealist, Mothma is the youngest Senator ever elected. While she deeply believes in the Republic, she is an opponent to the seemingly endless Clone Wars. Where others may be cowed by Palpatine''s assurances of imminent peace, Mothma often wonders if he has the best interests of the Republic at heart.', 3, 0, 1, 1, 0, 65554, 50, 20, 2460, 3630, 51331, 5000, 0, 0, 3620, 0, 5870, 1053810240, 0, 3, 1053810241, 0, 1, 0, 538, 1, 1, 1, 1, 0, 1, 18, 51, 0, 1, 1, 1, 0, 1, 130, 50, 1, 1000, 602, 11858, 0, 72075, 0, 1087, 3774, 0, 772, 3861, 12876, 12876, 27778, 0, 24590, 0, 3953, 78261, 0, 0, 0, '2014-12-25 06', '2015-11-25 06', '1-Card Light Side u0026 Neutral Acceleration [Sml]', 'A small chance to increase the EVA of your Light side or Neutral card positioned directly in front of this unit during battle. That unit''s attack frequency may also be increased by one. (Should that unit''s frequency be less than once per turn, the number of turns needed for the next attack will be decreased by one.) This Skill is not effective on Vehicles.', 51331, '1-Card Light Side u0026 Neutral Acceleration [Sml]', 'A small chance to increase the EVA of your Light side or Neutral card positioned directly in front of this unit during battle. That unit''s attack frequency may also be increased by one. (Should that unit''s frequency be less than once per turn, the number of turns needed for the next attack will be decreased by one.) This Skill is not effective on Vehicles.', 11, 1, 1, 1, 0, 4, 0, 0, 25, 30, 0, 30, 10, 2, 20, 40, '2015-11-18 06', 1, 10, 0, 0, '', 'Short', 'u003Cimg class=u0022rarity_s_04u0022 src=u0022http', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 1, 'u003Cimg class=u0022rarity_l_04u0022 src=u0022http', 6439, '1', '1 per Turn', 1, 1, 1, 0, '', '', '', 0, 3620, 5870, 0, 0, 2, 1, 0, 0, 0, 3620, 5870, 25, 50),
(1038520550, 'Dooku [Dark Lord]', 'card/chara/103852055/1038520550', 'After years of careful planning, misdirection, and manipulation, Dooku finally stands ready to bring his master''s vision for an ordered galaxy and an end to the Clone Wars to fruition. Staging the kidnapping of the Supreme Chancellor, Dooku now moves to quickly dispatch the only remaining Jedi who can still oppose him.', 4, 0, 2, 1, 0, 131145, 60, 28, 4000, 6080, 42002, 6800, 0, 0, 5340, 1, 8110, 1038520550, 0, 3, 1038520551, 0, 1, 0, 385, 1, 1, 1, 1, 0, 1, 18, 2, 0, 1, 1, 1, 0, 1, 140, 80, 0, 1000, 4, 2069, 0, 3261, 72464, 7, 580, 2647, 8, 236, 2814, 2868, 0, 5814, 0, 4317, 360, 719, 0, 0, 0, '2015-01-07 06', '2015-11-25 06', 'Pacify [Med]', 'When this unit is in the frontmost row, the ATK, HEA, and REP values of all units (including your own) that are in the same vertical column as the skill Card are constantly decreased by 10.0%.', 42002, 'Pacify [Med]', 'When this unit is in the frontmost row, the ATK, HEA, and REP values of all units (including your own) that are in the same vertical column as the skill Card are constantly decreased by %s.', 10, 1, 2, 2, 0, 0, 0, 0, 50, 100, 0, 100, 10, 2, 30, 40, '2015-11-18 06', 1, 10, 0, 0, '', 'Short', 'u003Cimg class=u0022rarity_s_05u0022 src=u0022http', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 1, 'u003Cimg class=u0022rarity_l_05u0022 src=u0022http', 6322, '1', '1 per Turn', 1, 1, 0, 0, '', '', '', 0, 5340, 8110, 0, 0, 2, 1, 0, 0, 0, 5340, 8110, 35, 50),
