(1027310650, 'C-3PO', 'card/chara/102731065/1027310650', 'C-3PO might be an unremarkable protocol droid to the rest of the galaxy, but to a primitive tribe of Ewoks, his golden carapace marks him as a god. With a few levitation tricks, courtesy of a Force wielding friend, C-3PO has everything he needs to convince the tribesmen to take arms against the Empire and abstain from eating his companions. ', 4, 0, 1, 1, 0, 16388, 60, 35, 1950, 6170, 32201, 7500, 0, 0, 3250, 0, 8580, 1027310650, 0, 3, 1027310651, 0, 1, 0, 273, 1, 1, 1, 1, 0, 1, 18, 51, 1, 1, 1, 1, 0, 1, 130, 100, 0, 1000, 4, 2069, 0, 3261, 72464, 7, 580, 1669, 8, 236, 2814, 2868, 5085, 0, 4317, 0, 360, 719, 0, 0, 0, '2015-01-21 06', '2015-11-25 06', 'The Golden God', 'Engages, at a fixed probability, attacks from all enemies this unit can potentially be attacked by, while at the same time increases its own EVA by 50.0% for that turn.  However, attack(s) from an enemy possessing the Pierce ATK Pattern cannot be engaged.', 32201, 'The Golden God', 'Engages, at a fixed probability, attacks from all enemies this unit can potentially be attacked by, while at the same time increases its own EVA by %s for that turn.  However, attack(s) from an enemy possessing the Pierce ATK Pattern cannot be engaged.', 1, 1, 10, 1, 0, 0, 0, 0, 104, 60, 0, 60, 50, 2, 100, 40, '2015-11-18 06', 1, 10, 0, 0, '', 'Short', 'u003Cimg class=u0022rarity_s_05u0022 src=u0022http', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 1, 'u003Cimg class=u0022rarity_l_05u0022 src=u0022http', 6311, '1', '1 per Turn', 1, 1, 0, 0, '', '', '', 0, 3250, 8580, 0, 0, 2, 1, 0, 0, 0, 3250, 8580, 110, 50),
