(1114410150, 'Clone Captain Rex', 'card/chara/111441015/1114410150', 'A man must truly be exceptional to stand out against a sea of clones. Rex is such a man. Though imbued with the same training as his fellow officers, years under the command of General Skywalker have taught Rex many unorthodox leadership techniques. While traditionalists might call these ''bad habits'', Rex''s near-flawless record speaks for itself. ', 4, 0, 1, 1, 0, 67593, 60, 34, 5880, 5620, 33001, 7400, 0, 0, 7950, 0, 7600, 1114410150, 0, 3, 1114410151, 0, 1, 0, 1144, 1, 1, 1, 1, 0, 1, 18, 41, 0, 1, 4, 1, 0, 1, 160, 70, 0, 1000, 4, 2069, 0, 3261, 72464, 7, 580, 1669, 8, 236, 2814, 2868, 5085, 0, 4317, 0, 360, 719, 0, 0, 0, '2015-03-18 06', '2015-11-25 06', 'Concentrated Fire', 'When an enemy is positioned in the same column as this unit, the ACC of this unit and that of Clone Trooperu003Cflashnodispu003E(u003Cspan class=''iconType11''u003Eu003C/spanu003E)u003C/flashnodispu003E units positioned in the same column and the columns to the left and right of this unit will increase by 20.0% at a fixed probability.  Also, the attacks of affected Clone Trooper units will be directed to the enemy unit in the same column as this unit for the turn that the Skill activates.  However, units possessing the Pierce ATK Pattern cannot have their target changed with this skill.', 33001, 'Concentrated Fire', 'When an enemy is positioned in the same column as this unit, the ACC of this unit and that of Clone Trooperu003Cflashnodispu003E(u003Cspan class=''iconType11''u003Eu003C/spanu003E)u003C/flashnodispu003E units positioned in the same column and the columns to the left and right of this unit will increase by %s at a fixed probability.  Also, the attacks of affected Clone Trooper units will be directed to the enemy unit in the same column as this unit for the turn that the Skill activates.  However, units possessing the Pierce ATK Pattern cannot have their target changed with this skill.', 15, 1, 11, 1, 0, 0, 20