(1114520150, 'Cad Bane', 'card/chara/111452015/1114520150', 'Cad Bane is no simple assassin. He is a mercenary that puts a price tag on the impossible. From springing Hutts from fortress prisons, to kidnapping legislators in the very halls of the Senate; Bane''s exploits leave statesmen and gangsters alike in awe. Whatever the job, no matter how difficult, Cad''s customers get what they pay for. ', 4, 0, 2, 1, 0, 257, 60, 35, 6060, 4280, 33101, 7500, 0, 1, 8080, 0, 6120, 1114520150, 0, 3, 1114520151, 0, 1, 0, 1145, 1, 1, 1, 1, 0, 1, 18, 42, 0, 1, 4, 1, 0, 1, 160, 110, 0, 1000, 4, 2069, 0, 3261, 72464, 7, 580, 2647, 8, 236, 2814, 2868, 0, 5814, 0, 4317, 360, 719, 0, 0, 0, '2015-03-18 06', '2015-11-25 06', 'Die Hard', 'This unit''s DEF and EVA increase by 25.0% when this unit''s remaining HP is 50% or less than its Max HP.', 33101, 'Die Hard', 'This unit''s DEF and EVA increase by %s when this unit''s remaining HP is 50%% or less than its Max HP.', 16, 1, 1, 1, 0, 0, 0, 0, 108, 100, 0, 100, 25, 2, 50, 40, '2015-11-18 06', 1, 10, 0, 0, '', 'Medium', 'u003Cimg class=u0022rarity_s_05u0022 src=u0022http', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 1, 'u003Cimg class=u0022rarity_l_05u0022 src=u0022http', 6377, '2', '2 per Turn', 1, 1, 0, 0, '', '', '', 0, 8080, 6120, 0, 0, 2, 1, 0, 0, 0, 8080, 6120, 60, 50),
