(1024410850, 'Master Yoda [Reluctant General]', 'card/chara/102441085/1024410850', 'Ever since the Naboo incident, Master Yoda''s mind has been disquieted. He knew that dark schemes were at work once a Sith Lord chose to reveal himself, but his insight into how far they extended was clouded. Now that massive armies have appeared on two worlds; Yoda knows that whatever plot is afoot must be stopped quickly and violently.', 4, 0, 1, 1, 0, 65577, 60, 29, 6930, 7200, 33201, 6900, 0, 0, 9000, 1, 9120, 1024410850, 0, 3, 1024410851, 0, 1, 0, 244, 1, 1, 1, 1, 0, 1, 18, 3, 0, 1, 1, 1, 0, 1, 170, 100, 0, 1000, 4, 2069, 0, 3261, 72464, 7, 580, 1669, 8, 236, 2814, 2868, 5085, 0, 4317, 0, 360, 719, 0, 0, 0, '2015-03-31 06', '2015-11-25 06', 'Form 4', 'This unit''s ATK, ACC, and EVA will increase by 20.0% at a fixed probability during Battles, however, its DEF will decrease by 20.0%.  Effects apply only for the turn this skill was activated for.', 33201, 'Form 4', 'This unit''s ATK, ACC, and EVA will increase by %s at a fixed probability during Battles, however, its DEF will decrease by %s.  Effects apply only for the turn this skill was activated for.', 1, 1, 1, 1, 0, 0, 0, 0, 109, 20, 0, 20, 20, 2, 40, 40, '2015-11-18 06', 1, 10, 0, 0, '', 'Short', 'u003Cimg class=u0022rarity_s_05u0022 src=u0022http', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 1, 'u003Cimg class=u0022rarity_l_05u0022 src=u0022http', 6309, '1', '1 per Turn', 1, 1, 0, 0, '', '', '', 0, 9000, 9120, 0, 0, 2, 1, 0, 0, 0, 9000, 9120, 50, 50),
