(1048620650, 'General Grievous [The Atrocious Executioner]', 'card/chara/104862065/1048620650', 'As the cyborg leader of the Droid Army, General Grievous is a superior commander. His skills at wielding up to four Lightsabers at once make him a deadly opponent. Many Jedi have fallen victim to his ruthless attacks. Whether they be Masters, or merely Padawans, no Jedi is safe.', 4, 0, 2, 1, 0, 131085, 60, 36, 6890, 6140, 32702, 7600, 0, 1, 9190, 2, 8780, 1048620650, 0, 3, 1048620651, 0, 1, 0, 486, 1, 1, 1, 1, 0, 1, 18, 11, 0, 1, 1, 1, 0, 1, 130, 70, 0, 1000, 6, 3103, 0, 4891, 108696, 11, 870, 3971, 12, 353, 4221, 4302, 0, 8721, 0, 6475, 540, 1079, 0, 0, 0, '2015-06-10 06', '2015-11-25 06', 'Counter Attack [Med]', 'This unit''s EVA will increase by 100.0% at a fixed probability during Battle.  If this unit then dodges an attack, it will immediately counter attack for that turn. (However, an S-Range unit can only attack an adjacent enemy.)', 32702, 'Counter Attack [Med]', 'This unit''s EVA will increase by %s at a fixed probability during Battle.  If this unit then dodges an attack, it will immediately counter attack for that turn. (However, an S-Range unit can only attack an adjacent enemy.)', 1, 1, 1, 0, 0, 0, 0, 0, 26, 40, 0, 40, 100, 2, 200, 40, '2015-11-18 06', 1, 10, 0, 0, '', 'Short', 'u003Cimg class=u0022rarity_s_05u0022 src=u0022http', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 1, 'u003Cimg class=u0022rarity_l_05u0022 src=u0022http', 6336, '2', '2 per Turn', 1, 1, 0, 0, '', '', '', 0, 9190, 8780, 0, 0, 2, 1, 0, 0, 0, 9190, 8780, 230, 50),
(1062821050, 'Darth Vader [Master of Evil]', 'card/chara/106282105/1062821050', 'Formerly the Jedi Knight known as Anakin Skywalker, Darth Vader rules the Galactic Empire as the right-hand of Emperor Palpatine. Never reaching the rank of Master as a Jedi under the training of Obi-Wan Kenobi, Vader instead became a Master of Evil, turning to the Dark Side as a Sith Lord. After years apart from his former Master, Obi-Wan tracked down Vader aboard the Death Star where they engaged in a fierce duel.', 4, 0, 2, 1, 0, 32841, 60, 39, 6710, 6000, 32601, 7900, 0, 1, 9330, 0, 8700, 1062821050, 0, 3, 1062821051, 0, 1, 0, 628, 1, 1, 1, 1, 0, 1, 18, 2, 0, 1, 1, 1, 0, 1, 170, 80, 0, 1000, 4, 2069, 0, 3261, 72464, 7, 580, 2647, 8, 236, 2814, 2868, 0, 5814, 0, 4317, 360, 719, 0, 0, 0, '2015-06-24 06', '2015-11-25 06', 'Jedi Purge', 'Constantly increases the ATK, DEF, ACC, and EVA of this Skill Card by 3.0% if the unit positioned directly in front is a Jediu003Cflashnodispu003E(u003Cspan class=''iconType5''u003Eu003C/spanu003E)u003C/flashnodispu003E.', 32601, 'Jedi Purge', 'Constantly increases the ATK, DEF, ACC, and EVA of this Skill Card by %s if the unit positioned directly in front is a Jediu003Cflashnodispu003E(u003Cspan class=''iconType5''u003Eu003C/spanu003E)u003C/flashnodispu003E.', 12, 1, 1, 2, 0, 0, 32, 0, 20, 100, 0, 100, 3, 2, 10, 40, '2015-11-18 06', 1, 10, 0, 0, '', 'Short', 'u003Cimg class=u0022rarity_s_05u0022 src=u0022http', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 1, 'u003Cimg class=u0022rarity_l_05u0022 src=u0022http', 6346, '1', '1 per Turn', 1, 1, 0, 0, '', '', '', 0, 9330, 8700, 0, 0, 2, 1, 0, 0, 0, 9330, 8700, 13, 50),
(1013311250, 'Ben Kenobi', 'card/chara/101331125/1013311250', 'Secretly the Jedi Master known as Obi-Wan Kenobi, Ben personally trained one of the most famous Jedi Knights in the galaxy, Anakin Skywalker, before he turned to the Dark Side and became Darth Vader. After years in hiding, Ben revealed his identity to Anakin''s son, Luke, and trained him in the ways of the force, leading Ben to a fateful duel with Vader aboard the infamous Death Star.', 4, 0, 1, 1, 0, 524321, 60, 36, 5330, 7300, 33401, 7600, 0, 0, 7840, 1, 9370, 1013311250, 0, 3, 1013311251, 0, 1, 0, 133, 1, 1, 1, 1, 0, 1, 18, 1, 0, 1, 1, 1, 0, 1, 170, 90, 0, 1000, 4, 2069, 0, 3261, 72464, 7, 580, 1669, 8, 236, 2814, 2868, 5085, 0, 4317, 0, 360, 719, 0, 0, 0, '2015-06-24 06', '2015-11-25 06', 'One with the Force', 'When defeated, this unit will reappear as a Force ghost and constantly increase the ATK, DEF, ACC, and EVA of all Jediu003Cflashnodispu003E(u003Cspan class=''iconType5''u003Eu003C/spanu003E)u003C/flashnodispu003E units (excluding itself) in the Formation by 2.0%.', 33401, 'One with the Force', 'When defeated, this unit will reappear as a Force ghost and constantly increase the ATK, DEF, ACC, and EVA of all Jediu003Cflashnodispu003E(u003Cspan class=''iconType5''u003Eu003C/spanu003E)u003C/flashnodispu003E units (excluding itself) in the Formation by %s.', 17, 1, 1, 1, 0, 0, 32, 0, 112, 100, 0, 100, 2, 2, 5, 40, '2015-11-18 06', 1, 10, 0, 0, '', 'Short', 'u003Cimg class=u0022rarity_s_05u0022 src=u0022http', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 1, 'u003Cimg class=u0022rarity_l_05u0022 src=u0022http', 6279, '1', '1 per Turn', 1, 1, 0, 0, '', '', '', 0, 7840, 9370, 0, 0, 2, 1, 0, 0, 0, 7840, 9370, 7, 50);
