(1063910650, 'Chewbacca [Wookiee Warrior]', 'card/chara/106391065/1063910650', 'Known as Chewie by his friends, Chewbacca is a Wookiee Warrior from Kashyyyk. Chewbaccau2019s brute strength makes him a fierce warrior on the battlefield and strikes fear into his opponents. Accompanying Han Solo as co-pilot of the u003Ciu003EMillennium Falconu003C/iu003E, he helped with a number of missions against the Empire.', 4, 0, 1, 1, 0, 278529, 60, 33, 3000, 6510, 31012, 7300, 0, 0, 6000, 1, 10020, 1063910650, 0, 3, 1063910651, 0, 1, 0, 639, 1, 1, 1, 1, 0, 1, 18, 51, 0, 1, 1, 1, 0, 1, 170, 80, 1, 1000, 4, 2069, 0, 3261, 72464, 7, 580, 1669, 8, 236, 2814, 2868, 5085, 0, 4317, 0, 360, 719, 0, 0, 0, '2015-07-08 06', '2015-11-25 06', 'Self ATK Up [Med]', 'Chance to increase this unit''s ATK by 50.0% for that turn.', 31012, 'Self ATK Up [Med]', 'Chance to increase this unit''s ATK by %s for that turn.', 1, 1, 2, 1, 0, 0, 0, 0, 1, 10, 0, 10, 50, 2, 100, 40, '2015-11-18 06', 1, 10, 0, 0, '', 'Short', 'u003Cimg class=u0022rarity_s_05u0022 src=u0022http', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 1, 'u003Cimg class=u0022rarity_l_05u0022 src=u0022http', 6351, '1', '1 per Turn', 1, 1, 0, 0, '', '', '', 0, 6000, 10020, 0, 0, 2, 1, 0, 0, 0, 6000, 10020, 115, 50),
