(1071011150, 'Leia Organa [A Time to Strike]', 'card/chara/107101115/1071011150', 'Leia had suffered unspeakable indignities at the hands of Jabba the Hutt. Stripped and kept as his slave and dancer, she bided her time, knowing her friends would provide the right moment for her to find freedom. Her patience was rewarded when Luke brought chaos to Jabbau0027s Sail Barge. Amidst the battle and panic, Leia took her time to strike, throwing her chains around the vile Jabbau0027s neck and ending his depravities.', 4, 0, 1, 1, 0, 16386, 60, 27, 5350, 6440, 35601, 6700, 0, 2, 6860, 2, 8160, 1071011150, 0, 3, 1071011151, 0, 10, 0, 710, 1, 1, 1, 1, 0, 1, 18, 52, 0, 1, 1, 1, 0, 1000, 0, 140, 0, 1000, 6, 9122, 0, 4787, 106383, 11, 851, 2451, 0, 0, 4182, 4182, 21260, 0, 18243, 0, 528, 1056, 142105, 0, 0, '2015-12-02 06', '2015-12-02 06', 'Strangle', 'Inflicts an initial, fixed minimum damage value of 50 to the enemy Male, Female, or Beast u003Cflashnodispu003E(u003Cspan class=u0027iconType0u0027u003Eu003C/spanu003E/u003Cspan class=u0027iconType1u0027u003Eu003C/spanu003E/u003Cspan class=u0027iconType9u0027u003Eu003C/spanu003E)u003C/flashnodispu003E Type Character Card positioned directly in front of this Skill Card.   The damage inflicted each turn after will increase by 40.0% (upper limit of 750), however, in exchange, this Skill Cardu0027s EVA will then decrease by 6% each time.  (When the target enemy in question is changed, the inflicted damage value and EVA value will be reset.)', 35601, 'Strangle', 'Inflicts an initial, fixed minimum damage value of 50 to the enemy Male, Female, or Beast u003Cflashnodispu003E(u003Cspan class=u0027iconType0u0027u003Eu003C/spanu003E/u003Cspan class=u0027iconType1u0027u003Eu003C/spanu003E/u003Cspan class=u0027iconType9u0027u003Eu003C/spanu003E)u003C/flashnodispu003E Type Character Card positioned directly in front of this Skill Card.   The damage inflicted each turn after will increase by %s (upper limit of 750), however, in exchange, this Sk